import { useState } from 'react';
import { Link } from 'react-router-dom';

const CommunityHub = () => {
  const [searchTerm, setSearchTerm] = useState('');

  return (
    <div style={{ 
      fontFamily: '-apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif',
      backgroundColor: '#f8fafc',
      minHeight: '100vh'
    }}>
      {/* Header - exact match to Figma */}
      <header style={{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '16px 24px',
        borderBottom: '1px solid #e5e7eb',
        backgroundColor: '#ffffff'
      }}>
        <div style={{ display: 'flex', alignItems: 'center', gap: '32px' }}>
          <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
            <span style={{ fontSize: '24px', color: '#22c55e' }}>ðŸŒ¾</span>
            <span style={{ 
              fontSize: '20px', 
              fontWeight: '600', 
              color: '#374151',
              letterSpacing: '-0.025em'
            }}>
              FarmLink 360
            </span>
          </div>
          <nav style={{ display: 'flex', gap: '24px' }}>
            <Link to="/marketplace" style={{ 
              color: '#6b7280', 
              textDecoration: 'none',
              fontSize: '16px',
              fontWeight: '400'
            }}>
              Marketplace
            </Link>
            <Link to="/community" style={{ 
              color: '#374151', 
              textDecoration: 'none',
              fontSize: '16px',
              fontWeight: '500'
            }}>
              Community
            </Link>
            <Link to="/profile" style={{ 
              color: '#6b7280', 
              textDecoration: 'none',
              fontSize: '16px',
              fontWeight: '400'
            }}>
              Profile
            </Link>
          </nav>
        </div>
        <button style={{
          backgroundColor: '#f3f4f6',
          color: '#374151',
          border: 'none',
          borderRadius: '8px',
          padding: '8px 16px',
          fontSize: '14px',
          fontWeight: '500',
          cursor: 'pointer'
        }}>
          Logout
        </button>
      </header>

      {/* Main Content - exact match to Figma */}
      <main style={{ 
        maxWidth: '1200px', 
        margin: '0 auto', 
        padding: '48px 24px'
      }}>
        {/* Title Section */}
        <div style={{ marginBottom: '48px' }}>
          <h1 style={{
            fontSize: '48px',
            fontWeight: '700',
            color: '#111827',
            margin: '0 0 16px 0',
            letterSpacing: '-0.025em',
            lineHeight: '1.1'
          }}>
            Community Hub
          </h1>
          <p style={{
            fontSize: '24px',
            color: '#6b7280',
            margin: '0',
            lineHeight: '1.4',
            fontWeight: '400'
          }}>
            Share your experience<br />
            with other farmers
          </p>
        </div>

        {/* Search Section */}
        <div style={{ 
          display: 'flex', 
          gap: '16px', 
          marginBottom: '64px',
          alignItems: 'center'
        }}>
          <input
            type="text"
            placeholder="Search for topics..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            style={{
              flex: '1',
              padding: '16px 20px',
              border: '2px solid #e5e7eb',
              borderRadius: '12px',
              fontSize: '16px',
              fontFamily: 'inherit',
              outline: 'none',
              backgroundColor: '#ffffff',
              color: '#9ca3af',
              transition: 'border-color 0.2s ease'
            }}
            onFocus={(e) => e.target.style.borderColor = '#22c55e'}
            onBlur={(e) => e.target.style.borderColor = '#e5e7eb'}
          />
          <button style={{
            backgroundColor: '#22c55e',
            color: '#ffffff',
            border: 'none',
            borderRadius: '12px',
            padding: '16px 32px',
            fontSize: '16px',
            fontWeight: '600',
            cursor: 'pointer',
            transition: 'background-color 0.2s ease'
          }}
          onMouseOver={(e) => e.target.style.backgroundColor = '#16a34a'}
          onMouseOut={(e) => e.target.style.backgroundColor = '#22c55e'}
          >
            Search
          </button>
        </div>

        {/* Recent Topics Section */}
        <section>
          <h2 style={{
            fontSize: '32px',
            fontWeight: '700',
            color: '#111827',
            margin: '0 0 32px 0',
            letterSpacing: '-0.025em'
          }}>
            Recent Topics
          </h2>

          <div style={{ display: 'flex', flexDirection: 'column', gap: '16px' }}>
            {/* Topic 1 */}
            <div style={{
              backgroundColor: '#ffffff',
              border: '2px solid #f3f4f6',
              borderRadius: '16px',
              padding: '32px',
              cursor: 'pointer',
              transition: 'all 0.2s ease'
            }}
            onMouseOver={(e) => {
              e.currentTarget.style.borderColor = '#e5e7eb';
              e.currentTarget.style.transform = 'translateY(-2px)';
              e.currentTarget.style.boxShadow = '0 4px 12px rgba(0, 0, 0, 0.1)';
            }}
            onMouseOut={(e) => {
              e.currentTarget.style.borderColor = '#f3f4f6';
              e.currentTarget.style.transform = 'translateY(0)';
              e.currentTarget.style.boxShadow = 'none';
            }}
            >
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
                <div>
                  <h3 style={{
                    fontSize: '20px',
                    fontWeight: '600',
                    color: '#111827',
                    margin: '0 0 8px 0'
                  }}>
                    Pest control for tomatoes
                  </h3>
                  <p style={{
                    fontSize: '14px',
                    color: '#6b7280',
                    margin: '0'
                  }}>
                    by John Doe
                  </p>
                </div>
                <span style={{
                  fontSize: '16px',
                  fontWeight: '500',
                  color: '#6b7280'
                }}>
                  12 replies
                </span>
              </div>
            </div>

            {/* Topic 2 */}
            <div style={{
              backgroundColor: '#ffffff',
              border: '2px solid #f3f4f6',
              borderRadius: '16px',
              padding: '32px',
              cursor: 'pointer',
              transition: 'all 0.2s ease'
            }}
            onMouseOver={(e) => {
              e.currentTarget.style.borderColor = '#e5e7eb';
              e.currentTarget.style.transform = 'translateY(-2px)';
              e.currentTarget.style.boxShadow = '0 4px 12px rgba(0, 0, 0, 0.1)';
            }}
            onMouseOut={(e) => {
              e.currentTarget.style.borderColor = '#f3f4f6';
              e.currentTarget.style.transform = 'translateY(0)';
              e.currentTarget.style.boxShadow = 'none';
            }}
            >
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
                <div>
                  <h3 style={{
                    fontSize: '20px',
                    fontWeight: '600',
                    color: '#111827',
                    margin: '0 0 8px 0'
                  }}>
                    Crop rotation techniques
                  </h3>
                  <p style={{
                    fontSize: '14px',
                    color: '#6b7280',
                    margin: '0'
                  }}>
                    by Sarah Lee
                  </p>
                </div>
                <span style={{
                  fontSize: '16px',
                  fontWeight: '500',
                  color: '#6b7280'
                }}>
                  7 replies
                </span>
              </div>
            </div>

            {/* Topic 3 */}
            <div style={{
              backgroundColor: '#ffffff',
              border: '2px solid #f3f4f6',
              borderRadius: '16px',
              padding: '32px',
              cursor: 'pointer',
              transition: 'all 0.2s ease'
            }}
            onMouseOver={(e) => {
              e.currentTarget.style.borderColor = '#e5e7eb';
              e.currentTarget.style.transform = 'translateY(-2px)';
              e.currentTarget.style.boxShadow = '0 4px 12px rgba(0, 0, 0, 0.1)';
            }}
            onMouseOut={(e) => {
              e.currentTarget.style.borderColor = '#f3f4f6';
              e.currentTarget.style.transform = 'translateY(0)';
              e.currentTarget.style.boxShadow = 'none';
            }}
            >
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
                <div>
                  <h3 style={{
                    fontSize: '20px',
                    fontWeight: '600',
                    color: '#111827',
                    margin: '0 0 8px 0'
                  }}>
                    Irrigation tips for droughts
                  </h3>
                  <p style={{
                    fontSize: '14px',
                    color: '#6b7280',
                    margin: '0'
                  }}>
                    by Michael Brown
                  </p>
                </div>
                <span style={{
                  fontSize: '16px',
                  fontWeight: '500',
                  color: '#6b7280'
                }}>
                  5 replies
                </span>
              </div>
            </div>
          </div>
        </section>
      </main>
    </div>
  );
};

export default CommunityHub;
